import React, { useState } from 'react';
import HeroSection from './HeroSection';
import ProductSuiteSection from './ProductSuiteSection';
import FeaturesSection from './FeaturesSection';
import CardsSection from './CardsSection';
import FAQSection from './FAQSection';
import CaseStudySection from './CaseStudySection';
import GreenCtaSection from './GreenCtaSection';
import FooterSection from './FooterSection';
import BottomDarkSection from './BottomDarkSection';


const Home = () => {
  return (
    <div className="container-fluid px-0" style={{ background: '#fff' }}>
      {/* Navbar (keep inline for now) */}
      {/* ...existing code for navbar... */}
      <HeroSection />
      <ProductSuiteSection />
      <FeaturesSection />
      <CardsSection />
      <FAQSection />
      <CaseStudySection />
      <GreenCtaSection />
      <FooterSection />
      <BottomDarkSection />
    </div>
  );
};

export default Home;
